select 'insert into cadastro.cliente_imovel (clim_id, clie_id, imov_id, clim_dtrelacaoinicio, clim_dtrelacaofim, cifr_id, clim_tmultimaalteracao, crtp_id, clim_icnomeconta) values ((SELECT NEXTVAL ('||CHR(39)||'cadastro.sequence_cliente_imovel'||CHR(39)||')), ' ||clie_id||', '|| imov_id ||', '||CHR(39)|| clim_dtrelacaoinicio ||CHR(39)||', null, null, now(), '|| 
CASE
           when crtp_id = 1 THEN 2
           ELSE 1
      end ||','||
CASE
           WHEN clim_icnomeconta = 1 THEN 2
           ELSE 1
      end ||' );'as aa
from cadastro.cliente_imovel
where imov_id in (
					select ci.imov_id from cadastro.cliente_imovel as ci
					inner join cadastro.imovel as i
					on ci.imov_id = i.imov_id
					where i.last_id in (3,5,6,8)
					       AND i.lest_id in (3,5,6,8)
					group by ci.imov_id
					having count (ci.imov_id) < 2
				 )


